export default function CalendarioSecion() {
  return (
    <section className="calendario-section">
      <div className="calendario-textcontainer">
      <p className="calendario-text">“Durante años pensé que controlar mi diabetes era simplemente evitar que se descontrole. Pero entendí que no se trata solo de números: se trata de vivir con libertad, con más energía, con confianza sintiéndome bien, evitando malestares, descompensaciones y fluctuaciones innecesarias.</p>
        
      <p className="calendario-text"> Cuando empecé este proceso, tenía una HbA1c de 7.2%. Hoy, después de cambios sostenibles en mi alimentación, entrenamiento, calidad de sueño y gestión del estrés, logré una HbA1c de 5.4%. Hoy me siento más fuerte, más libre, más seguro y más en paz conmigo mismo. Esta transformación sí es posible, y también puede ser la tuya.” </p>
        
      <p className="calendario-text">  Si querés dejar de sobrevivir con tu diabetes y empezar a vivir con propósito, estás en el lugar correcto.</p>
      </div>
      <div className="calendario">
        <a href=""></a>
      </div>
    </section>
  );
}
